In 1975 Led Zeppelin was undoubtedly the largest band on the planet. His tour of the United States, two months before the Earls Court dates, became in one of the most profitable in history. This same year also saw Led Zeppelin release their sixth studio album Physical Graffiti, which debuted at number 1 on the UK and US charts. And he saw his six previous albums re-enter the charts in these countries.
So, if you are in the high point in your career, so how can you top that? You play a sellout set of dates that go on to be remembered as one of the best live show.
Initially the band were only going to play the 23 to 25 May, but two further dates had to be added, 17 and 18 May, due to popular demand. In fact Mel Bush the promoter behind the Earls Court gigs said that they added these dates because there was a “demand unprecedented in the history of rock music.” 
The band shipped over their 40-ton stage earlier in the year for the shows, along with putting up a huge projection screen so people could watch the performance. Something that’s pretty standard these days but back then it was one of the first times it had been done. It also had a cutting edge sound equipment by Showco.
Among the songs included in the concert's set list were: "Rock and Roll", “The Song Remains the Same", "Dazed and Confused", "Stairway to Heaven", "Whole Lotta Love" or "Black Dog”.
The concert on 25 May, is considered to be the best of the band. While each night was around three hours, this swansong show went on for nearly four hours.
The music journalist Chris Welch wrote about the shows: "Jimmy Page was waving his violin bow against the guitar strings, producing fearsome gothic howls while Robert Plant acting as a leader who guided us through the story of this band of incombustible monsters".

